import React, { useState } from 'react';
import axios from 'axios';

const areas = [
    'Tecnologia', 
    'Saúde', 
    'Educação', 
    'Finanças', 
    'Consultoria'
    // Adicione outras áreas conforme necessário
  ];

  const provincias = [
    'Luanda', 
    'Benguela', 
    'Huambo', 
    'Namibe', 
    'Malanje'
    // Adicione outras províncias conforme necessário
  ];
export const FormularioEmpreendedor = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: '',
    nome: '',
    genero: '',
    data_nascimento: '',
    bi: '',
    area_atuacao: '',
    provincia: '',
    telefone: '',
    endereco: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:3001/register/empreendedor', formData);
      console.log('Empreendedor registrado com sucesso:', response.data);
    } catch (error) {
      console.error('Erro ao registrar empreendedor:', error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="email" name="email" value={formData.email} onChange={handleChange} placeholder="Email" required />
      <input type="password" name="password" value={formData.password} onChange={handleChange} placeholder="Palavra Passe" required />
      <input type="text" name="nome" value={formData.nome} onChange={handleChange} placeholder="Nome" required />
      <input type="text" name="genero" value={formData.genero} onChange={handleChange} placeholder="Gênero" required />
      <input type="date" name="data_nascimento" value={formData.data_nascimento} onChange={handleChange} placeholder="Data de Nascimento" required />
      <input type="text" name="bi" value={formData.bi} onChange={handleChange} placeholder="BI" required />
      <input type="text" name="area_atuacao" value={formData.area_atuacao} onChange={handleChange} placeholder="Área de Atuação" required />
      <input type="text" name="provincia" value={formData.provincia} onChange={handleChange} placeholder="Província" required />
      <input type="text" name="telefone" value={formData.telefone} onChange={handleChange} placeholder="Telefone" required />
      <input type="text" name="endereco" value={formData.endereco} onChange={handleChange} placeholder="Endereço" required />
      <button type="submit">Registrar Empreendedor</button>
    </form>
  );
};
